import {
  IconAlignJustified,
  IconSearch,
  IconCameraSelfie,
  IconPhoto,
  IconAlignLeft,
  IconPhotoMinus,
  IconCircleXFilled,
} from "@tabler/icons-react";
import { Accordion, Container, Text, rem } from "@mantine/core";
import {} from "@tabler/icons-react";

const SideAppBar = () => {
  return (
    <div>
      <Container
        my="xs"
        bg="var(--mantine-color-blue-light)"
        className="rounded-lg p-4 transition duration-300 ease-in-out hover:border-gray-300"
        style={{ borderRadius: "5px" }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "flex-end",
          }}
        >
          <div className="mr-4" style={{ alignItems: "flex-start" }}>
            <IconAlignLeft />
          </div>
          <div style={{ display: "inline-block" }}>
            <IconSearch style={{ display: "inline-block" }} />
            <IconPhotoMinus style={{ display: "inline-block" }} />
          </div>
        </div>
      </Container>
      <Accordion transitionDuration={0}>

      </Accordion>
    </div>
  );
};

export default SideAppBar;
